import React,{useState,useEffect} from 'react';
import './App.css';

function App() {
  const [crypto, setCrypto] = useState<[]>([])
  useEffect(()=>{
    fetch("https://investing-cryptocurrency-markets.p.rapidapi.com/coins/list?edition_currency_id=12&time_utc_offset=28800&lang_ID=1&sort=PERC1D_DN&page=1", {
      "method": "GET",
      "headers": {
        "x-rapidapi-host": "investing-cryptocurrency-markets.p.rapidapi.com",
        "x-rapidapi-key": "a07f0d8d02mshcb403096e9493b5p193e69jsn15e5aa0c963f"
      }
    })
    .then(response => response.json())
    .then(result => setCrypto(result.data[0].screen_data.crypto_data))
    .catch(err => {
      console.error(err);
    });
  },[])
  console.log(crypto);

  return (
    <div className="App">
     <h1>first react app with typescript</h1>
    </div>
  );
}

export default App;
